using System;
using System.Collections.Generic;
using System.Linq;
using Bandar.Domain;
using Bandar.Domain.Entities;

namespace Bandar.Api.Controllers
{
    public class TimeLineController : BaseApiController
    {
        public class TimeLineData : TimeLineEntity
        {
            public TimeLineData(TimeLineEntity entity)
            {
                EventTitle = entity.EventTitle;
                EventDate = entity.EventDate;
                Id = entity.Id;
                CreatedBy = entity.CreatedBy;
                CreatedDate = entity.CreatedDate;
                ModifiedBy = entity.ModifiedBy;
                ModifiedDate = entity.ModifiedDate;
                EventType = entity.GetType().Name;
            }

            public string EventType { get; set; }

            public override string EventTitle { get; }

            public override DateTime EventDate { get; }

            
        }


        public IEnumerable<TimeLineEntity> Get()
        {
            return Repository.GetAll<Band>()
                .Union(Repository.GetAll<Place>().Cast<TimeLineEntity>())
                .Union(Repository.GetAll<Event>()).OrderByDescending(x => x.EventDate)
                .Select(x => new TimeLineData(x));
        }

        public void Post()
        {

            var image =
                "data:image/jpeg;base64,";

            var rocket =
                "data:image/jpeg;base64,";

            var genres = new List<string>
            {
                "Rock",
                "Pop",
                "Cumbia Villera",
                "Electronica",
                "ElectroPop",
                "Reggae",
                "Etc"
            };

            var places = new List<string>
            {
                "The Cavern of Rock",
                "Drugs And Music",
                "El Rejunte de Jose C. Paz"
            };

            var bands = new List<string>
            {
                "La Banda del Golden Rocket",
                "Baila Guacha",
                "The BlahBlah Band"
            };


            foreach (var genre in genres)
                Repository.Create(new Genre {Id = Guid.NewGuid(), Name = genre});

            var thegenres = Repository.GetAll<Genre>().ToList();

            Repository.Save();

            var rockGenre = thegenres.FirstOrDefault(x => x.Name == "Rock");
            var popGenre = thegenres.FirstOrDefault(x => x.Name == "Pop");
            var cumbiaGenre = thegenres.FirstOrDefault(x => x.Name == "Cumbia Villera");

            foreach (var place in places)
            {
                Repository.Create(new Place
                {
                    Id = Guid.NewGuid(),
                    Name = place,
                    Genres = place == "The Cavern of Rock"
                        ? new List<Genre> {rockGenre}
                        : place == "Drugs And Music"
                            ? new List<Genre> {popGenre, rockGenre }
                            : new List<Genre> {cumbiaGenre}
                });
            }

            foreach (var band in bands)
                Repository.Create(new Band
                {
                    Id = Guid.NewGuid(),
                    Name = band,
                    Genre = band == "Baila Guacha"
                        ? cumbiaGenre
                        : band == "La Banda del Golden Rocket"
                            ? popGenre
                            : rockGenre,
                    Image = band == "Baila Guacha" ? image : band == "La Banda del Golden Rocket" ? rocket : null
                });

            Repository.Save();


            var drugsAndMusic = Repository.GetAll<Place>().First(x => x.Name == "Drugs And Music");
            var laBanda = Repository.GetAll<Band>().First(x => x.Name == "La Banda del Golden Rocket");
            var laBandaAtDrugs = new Event
            {
                Id = Guid.NewGuid(),
                Place = drugsAndMusic,
                Band = laBanda,
                Date = DateTime.Now.AddDays(34)
            };
            Repository.Create(laBandaAtDrugs);

            var elRejunte = Repository.GetAll<Place>().First(x => x.Name == "El Rejunte de Jose C. Paz");
            var bailaGuacha = Repository.GetAll<Band>().First(x => x.Name == "Baila Guacha");
            var bailaAtElRejunte = new Event
            {
                Id = Guid.NewGuid(),
                Place = elRejunte,
                Band = bailaGuacha,
                Date = DateTime.Now.AddDays(65)
            };

            Repository.Create(bailaAtElRejunte);

            var theCavern = Repository.GetAll<Place>().First(x => x.Name == "The Cavern of Rock");
            var theBlah = Repository.GetAll<Band>().First(x => x.Name == "The BlahBlah Band");

            var rating1 = new Rating
            {
                Id = Guid.NewGuid(),
                Points = 1,
                Feedback = "Nunca mas toco ahi!!!"
            };

            Repository.Create(rating1);

            var bandRating1 = new Rating
            {
                Id = Guid.NewGuid(),
                Points = 3,
                Feedback = "Estaban todos borrachos!"
            };

            Repository.Create(bandRating1);

            var theBlahAtTheCavern = new Event
            {
                Id = Guid.NewGuid(),
                Place = theCavern,
                Band = theBlah,
                Date = DateTime.Now.AddDays(12),
                PlaceRating = rating1,
                BandRating = bandRating1
            };

            Repository.Create(theBlahAtTheCavern);

            var rating = new Rating
            {
                Id = Guid.NewGuid(),
                Points = 3,
                Feedback = "El lugar esta masomeno. La gente re amarga"
            };

            Repository.Create(rating);

            var bandRating = new Rating
            {
                Id = Guid.NewGuid(),
                Points = 5,
                Feedback = "Genial la banda. Viva peron!"
            };

            Repository.Create(bandRating);

            var bailaAtTheCavern = new Event
            {
                Id = Guid.NewGuid(),
                Place = theCavern,
                Band = bailaGuacha,
                Date = DateTime.Now.AddDays(43),
                BandRating = bandRating,
                PlaceRating = rating
            };

            Repository.Create(bailaAtTheCavern);


            Repository.Save();
        }
    }
}